import { Button, Table, TableCell, TableHead, TableRow } from "@mui/material"


const Categories = () => {
    return (
      <>
            <Button>Categories</Button>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableCell>
                            All Categories
                        </TableCell>
                    </TableRow>
                </TableHead>

            </Table>
      </>
    );
};

export default Categories;
